  \"Transparent and Flexible Electrodynamic Coating for Particulate Removal Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 6,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T00:49:47.240883\",\n\t\"name\": \"transparent-and-flexible-electrodynamic-coating-for-particulate-removal-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"NASA has an unmet need for clean, dust-free
  surfaces critical for many mission applications: solar panels and collectors, aircraft
  components, optical windows, photographic equipment, and flight suits. However,
  dust mitigation and removal remains a difficult task, particularly given the nature
  and morphology of space-born particulate materials and the strong bonds they can
  develop with any surface. Several mechanical techniques involving shaking and wiping
  have been devised to address this problem, but these are difficult to implement
  and expensive to maintain over mission life cycles.rnOne successful innovation that
  has been developed and tested for dust removal is the \"electrodynamic shield\"
  or EDS. The EDS is composed of inter-digitated, electrically conductive electrodes
  connected to an AC power supply. The main parameters that govern the efficiency
  of dust removal are the voltage and the frequency of the AC signal applied to the
  electrodes. Poly Adaptive, LLC, proposes to investigate the novel application and
  use of nanoscale materials to address severe limitations of existing EDS designs
  caused by the metallic electrodes that reduce the amount of radiation reaching solar
  panels. Successful Phase I results will show the feasibility of an EDS that is transparent
  and can be placed on top of any surface.\",\n\t\"license_title\": \"U.S. Government
